INSERT INTO `tip` VALUES (0,1,'웨딩홀 예약 시 성수기(5~6월, 9~10월)는 최소 6개월 전에 예약하는 것이 좋습니다.'),(0,2,'웨딩홀 투어 시 주차 공간과 교통 접근성도 함께 확인하세요.'),(1,3,'스튜디오 촬영은 메이크업과 헤어 준비 시간을 포함해 최소 4시간 이상 소요됩니다.'),(1,4,'스튜디오 예약 시 야외 촬영 옵션이 포함되어 있는지 확인하고, 날씨 변동에 대비한 대체 계획도 문의하세요.'),(2,5,'드레스 피팅은 결혼식 2-3개월 전에 시작하고, 최종 피팅은 2주 전에 진행하는 것이 이상적입니다.'),(2,6,'드레스 선택 시 결혼식 장소와 계절을 고려하세요. 야외 결혼식은 바람에 날리는 긴 베일이나 트레인이 불편할 수 있습니다.'),(3,7,'메이크업 샵에 방문 시 평소 사용하는 스킨케어 제품을 바르지 말고 맨 얼굴으로 방문하는 것이 좋습니다.'),(3,8,'메이크업 트라이얼은 결혼식 1-2개월 전에 진행하고, 당일에 착용할 액세서리나 머리장식을 함께 가져가는 것이 좋습니다.'),(4,9,'한복 대여 시 결혼식 전날 미리 맞춰보고, 소품(노리개, 비녀 등)도 함께 확인하세요.'),(4,10,'폐백 한복은 움직임이 편한 디자인을 선택하고, 신부 한복의 색상은 전통적으로 빨간색 계열이 많이 사용됩니다.'),(5,11,'맞춤 예복은 최소 2개월 전에 주문하고, 최종 피팅은 결혼식 2주 전에 진행하세요.'),(5,12,'신랑 구두는 결혼식 전에 미리 신어서 발이 익숙해지도록 하는 것이 좋습니다.'),(6,13,'스냅 촬영은 일출이나 일몰 시간대(골든아워)에 진행하면 더 아름다운 사진을 얻을 수 있습니다.'),(6,14,'야외 스냅 촬영 시 날씨에 따른 대체 장소나 날짜 변경 정책을 미리 확인하세요.'),(7,15,'청첩장은 결혼식 2개월 전에 발송하는 것이 적절하며, 해외 거주 하객에게는 3개월 전에 보내는 것이 좋습니다.'),(7,16,'청첩장에 식장 약도와 교통편, 주차 정보를 자세히 기재하면 하객들의 편의성이 높아집니다.'),(8,17,'결혼식 직전 피부 관리는 최소 1주일 전에 마무리하고, 당일에는 가벼운 마사지나 팩으로 진정시키는 것이 좋습니다.'),(8,18,'웨딩 준비 중 스트레스로 인한 피부 트러블을 방지하기 위해 6개월 전부터 정기적인 관리를 시작하세요.'),(9,19,'신혼여행은 결혼식 다음날보다 1-2일 후에 출발하는 것이 피로감 해소에 도움이 됩니다.'),(9,20,'신혼여행 목적지가 해외인 경우, 여권과 비자 유효기간을 미리 확인하고 여행자 보험에 가입하세요.'),(10,21,'결혼식 당일에는 신부 대기실에 간단한 간식과 물을 준비해두세요. 긴장으로 식사를 거르기 쉽습니다.'),(10,22,'결혼식 진행 순서와 타임테이블을 인쇄해 주례자, 혼주, 들러리에게 미리 공유하면 당일 진행이 수월합니다.');
/*!40000 ALTER TABLE `tip` ENABLE KEYS */;
